import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css'; // Ensure your CSS file is updated with the new styles

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate('/');
  };

  return (
    <header>
      <nav className="navbar">
        <Link to="/" className="navbar-logo">
          <span role="img" aria-label="eye" className="logo-emoji">üëÅÔ∏è</span>
          <span className="logo-text">Reporter</span>
        </Link>
        <button className="hamburger-menu">
          <span className="hamburger"></span>
        </button>
        <ul className="navbar-menu">
          <li className="navbar-link">
            <Link to="/create-report">Create Record</Link>
          </li>
          <li className="navbar-link">
            <Link to="/view-reports">My Records</Link>
          </li>
          <li className="navbar-link active">
            <Link to="/dashboard">Dashboard</Link>
          </li>
          <li className="navbar-link active" id="admin">
            <Link to="/admin">Admin</Link>
          </li>
          <li className="navbar-link" id="logout">
            <button onClick={handleLogout}>Logout</button>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
